  input: '"TEXT","F3XA","C00084954","The Committee is filing an Amended 12-Day Pre-General
    Report (10/1/06-10/18/06) to correct year to date totals and to clarify the aggregate
    year-to-date total for contributions received from Jim Walton per your request
    in a letter from the Federal Election Commission dated November 9, 2006.    The
    Calendar Year to Date totals for Lines 21(a)(i), 21 (a)(ii) and 32, Column B of
    the Detailed Summary Page have been corrected and are properly reported.    The
    Committee received contributions from Jim Walton on January 14, 2006 for $10,000.00
    and on October 3, 2006 for $10,000.00 as reported on Schedule A Itemized Receipts
    supporting Line 11(a). On September 19, 2006 the Committee made a contribution
    refund to Jim Walton for $20,000.00 as reported on Schedule B Itemized Disbursements
    supporting Line 28(a). Therefore the aggregate year-to-date total of contributions
    for Jim Walton on the 12-Day Pre-General Report is correct as reported.        On
    the original report a voided check for $6.82 had been reported on the Detailed
    Summary Page of Receipts Line 15 as an offset to operating expenditures. On the
